import{_ as e,c as r,o as a,d as t}from"./app.590c1fbf.js";const m=JSON.parse('{"title":"SourceMap 定位错误","description":"","frontmatter":{},"headers":[{"level":2,"title":"参考资料","slug":"参考资料","link":"#参考资料","children":[]}],"relativePath":"webpack/SourceMap.md"}'),c={name:"webpack/SourceMap.md"},i=t('<h1 id="sourcemap-定位错误" tabindex="-1">SourceMap 定位错误 <a class="header-anchor" href="#sourcemap-定位错误" aria-hidden="true">#</a></h1><p>简单来说，Sourcemap 就是一个信息文件，它里面存储着代码转换前后的对应位置信息，也就是转换压缩后的代码所对应的转换前的源代码位置，是源代码和生产代码的映射， Sourcemap 解决了在打包过程中，代码经过压缩，去空格以及 babel 编译转化后，由于代码之间差异性过大，debug 困难的问题</p><p>SourceMap 总结</p><ul><li>映射转换过后的代码和源代码之间的关系</li><li>代码中引入 // # sourceMappingURL=xxx.js.map 启用</li><li>sourceMap 解决了源代码和运行代码不一致所产生的问题</li><li>不只是 js 文件有，css 文件也有</li><li>核心原理是 base64 vlq 编码</li></ul><p>sentry 使用 webpack 上传 sourceMap 源文件定位错误到更详细具体的代码片段</p><h2 id="参考资料" tabindex="-1">参考资料 <a class="header-anchor" href="#参考资料" aria-hidden="true">#</a></h2><ul><li><a href="https://mp.weixin.qq.com/s?__biz=MzI1ODE4NzE1Nw==&amp;mid=2247487962&amp;idx=1&amp;sn=ccaa072d3c6e5bad3689e0edf5590cc1&amp;scene=21#wechat_redirect" target="_blank" rel="noreferrer">sourceMap 知多少</a></li><li><a href="https://mp.weixin.qq.com/s/Q8g3ye8owv9HrFFFr7YhsQ" target="_blank" rel="noreferrer">万字长文：关于 sourcemap，这篇文章就够了</a></li><li><a href="https://mp.weixin.qq.com/s/kfJ5lqD4M-zT7qSx2sAVUQ" target="_blank" rel="noreferrer">弄懂 SourceMap，前端开发提效 100%</a></li><li><a href="https://juejin.cn/post/7008039749747212319" target="_blank" rel="noreferrer">何为 SourceMap？讲讲 SourceMap 食用姿势</a></li><li><a href="https://mp.weixin.qq.com/s/M9TqtDofRzZwR0bb77voEA" target="_blank" rel="noreferrer">如何让调试线上 JS 报错像调试本地源码一样优雅？</a></li><li><a href="https://dsx2016.com/?p=1220" target="_blank" rel="noreferrer">sentry使用webpack上传sourceMap源文件定位错误到更详细具体的代码片段</a></li></ul>',7),o=[i];function p(l,s,n,_,u,d){return a(),r("div",null,o)}const f=e(c,[["render",p]]);export{m as __pageData,f as default};
